import React from 'react'
import { Form, Input, Button, Tabs, Card, Table } from 'antd'
import { connect } from 'react-redux'

const mapStateToProps = state => {
    return {
        dataProps: state
    }
}

const { TabPane } = Tabs

class AnimalServeyComponent extends React.Component {


    render() {
        return (
            <div>
                <Card style={{ height: '80vh' }}>
                    <Button>{'ค้นข้อมูล'}</Button>
                    <Tabs defaultActiveKey="1" >
                        <TabPane tab="ข้อมูล" key="1">
                            {'Content of Tab Pane 1'}
                        </TabPane>
                        <TabPane tab="บันทึกการพบเจอ" key="2">
                            {"  Content of Tab Pane 2"}
                        </TabPane>
                        <TabPane tap="ประวัติการบันทึกข้อมูล" key="3">
                            {" ประวัติการบันทึกข้อมูล"}
                        </TabPane>
                    </Tabs>
                </Card>
            </div>
        )
    }
}

export default connect(mapStateToProps)(AnimalServeyComponent)
